import Button from '@mui/material/Button';
import { styled } from '@mui/material/styles';

class PetImage extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <img>

            </img>
        )
    }
}

const PorterButton = styled(Button)(({ theme }) => ({
    textTransform: 'capitalize',
}));

class AnswerButton extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <PorterButton variant='outlined'>Porter</PorterButton>
        )
    }
}

export {
    PetImage, 
    AnswerButton
};
